import React from "react";
import Box from '@mui/material/Box';
import zIndex from "@mui/material/styles/zIndex";
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';
import { border, textAlign } from "@mui/system";
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';


function RedBar() {
    return (
      <Box
        sx={{
          height: 3
        }}
      />
    );
  }

function Signup(){

    return(

        <Box
      sx={{
        width: 850,
        height: 350,
        position:'relative',
        left:400,
        top:250,
        display:'flex',
        flexDirection:'row',

         }}>
             <Box sx={{
                    position:'relative',
                    top: 20,
                    left: 120,
                    width: 624,
                    height: 391,
                    background:' #F5F5F5 0% 0% no-repeat padding-box',
                    borderRadius: 21,
                    opacity: 1,
                    border:'1px solid green'




             }}>
                 <Avatar

                    src="../signin/signin1.jpg"
                    sx={{ 
                        position:'relative',
                        top: '20%',
                        left: 100,
                        width: 245,
                        height: 245,
                     }}
                 />
                 <Box sx={{position:'relative',

                                   top:'16%',
                                   left:'22%',
                                   width: 209,
                                   height: 24,

                                   font: 'normal normal medium 18px/24px Roboto',
                                   letterSpacing: 0,
                                   color: '#0A0102',
                                    textTransform: 'uppercase',
                                    opacity: 1,

                                    //text:'Online Book Shopping',





                 }}>
                 <h2 >Online Book Shopping</h2>
                 </Box>


             </Box>

             <Box sx={{
                 top: 166,
                 left: 658,
                 width: 389,
                 height: 425,
                 background: '#FFFFFF 0% 0% no-repeat padding-box',
                 boxShadow: '0px 5px 15px #00000029',
                 border: '1px solid #E4E4E4',
                 borderRadius: 6,
                 opacity: 1,
                 zIndex:4,
                 display:'flex',
                 flexDirection:'column'
                 }}>
                     <Box sx={{
                         position:'relative',
                         top: 10,
                         left: 190,
                         width: 72,
                         height: 33,
                         textAlign: 'left',
                         font: 'normal normal medium 25px/33px Roboto',
                         letterSpacing: 0,
                         color: '#0A0102',
                         textTransform:'uppercase',
                         opacity: 1


                     }}><h2>SIGNUP</h2></Box>
                     <Box
                        sx={{
                            display: "flex",
                            flexDirection: "column",
                            "& .MuiTextField-root": { width: "30ch" },
                            position:'relative',
                            left:15,
                            top:30
                        }}
                        >
                        <RedBar />
                        <TextField label={'margin="none"'} id="margin-none" />
                        <RedBar />
                        <TextField label={'margin="dense"'} id="margin-dense" margin="dense" />
                        <RedBar />
                        <TextField label={'margin="normal"'} id="margin-normal" margin="normal" />
                        <RedBar />
                        <TextField label={'margin="normal"'} id="margin-normal" margin="normal" />

                        <Button variant="contained" style={{position:'relative',background: '#A03037 0% 0% no-repeat padding-box'}}
                         >Login</Button>



                     </Box>





             </Box>

        </Box>
    )

}
export default Signup
